type DayPlane struct {
	title    string
	problems []Problem
}

func (dp DayPlane) Markdown() string {
	str := fmt.Sprintf("#### %s\n\n", dp.title)
	for _, v := range dp.problems {
		str += fmt.Sprintf("- [ ] [%s](https://leetcode-cn.com%s) [%s] [%s]\n\n", v.title, v.url, v.level, strings.Join(v.tags, ", "))
	}
	return str
}

type Problem struct {
	title string
	url   string
	tags  []string
	level string
}

