	d, err := goquery.NewDocumentFromReader(strings.NewReader(str))
	if err != nil {
		panic(err)
	}
	var dps []DayPlane

	d.Find(".grid-flow-row").Children().Each(
		func(i int, div *goquery.Selection) {
			flex := div.Find(".flex")
			title := fmt.Sprintf("%s：%s", flex.Find("h1").Text(), flex.Find("h2").Text())
			dp := DayPlane{
				title:    title,
				problems: []Problem{},
			}
			div.Find(".bg-overlay-3").Children().Each(
				func(j int, sdiv *goquery.Selection) {
					p := Problem{
						tags: []string{},
					}
					sdiv.Children().Each(
						func(sj int, tmp *goquery.Selection) {
							if sj == 1 {
								p.level = tmp.Text()
							}
						},
					)
					sdiv.Find(".flex").Each(
						func(k int, sflex *goquery.Selection) {
							if k == 0 {
								a := sflex.Find("a")
								p.title = a.Text()
								p.url, _ = a.Attr("href")
							} else {
								sflex.Find("a").Each(
									func(l int, a *goquery.Selection) {
										p.tags = append(p.tags, a.Text())
									},
								)
							}
						},
					)
					dp.problems = append(dp.problems, p)
				},
			)
			dps = append(dps, dp)
		},
	)

	for _, v := range dps {
		fmt.Println(v.Markdown())
	}

